import React, { useEffect, useState } from "react";
import { getTeams } from "../../api/api";
export default function Teams() {
  const [teams, setTeams] = useState([]);
  useEffect(() => {
    getTeams()
      .then(res => {
        return res.json();
      })
      .then(data => {
        setTeams(data.data);
      })
      .catch(error => console.error(error));
  }, []);
  //   console.log(teams.data);

  return (
    <div>
      <ul></ul>
    </div>
  );
}
